export default {
  mounted(el, binding) {
    console.log('zxc')
    document.addEventListener('mousemove', (event) => {

      el.style.transform = "translate("+ event.x / binding.value + "px, " + event.y / binding.value +"px)"
    })

  },
  unmounted() {
    console.log('endzxc')
  }


};
